import React, { PureComponent } from 'react';
import './../css/test.css'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const data = [
    {
        name: '2078',
        Projects: 15,
        Cost : 37500000,
        amt: 2400,
    },
    {
        name: '2079',
        Projects: 20,
        Cost : 37500000,
        amt: 2210,
    },
    {
        name: '2080',
        Projects: 25,
        Cost : 37500000,
        amt: 2290,
    },
    {
        name: '2081',
        Projects: 30,
        Cost : 37500000,
        amt: 2000,
    },
    {
        name: '2082',
        Projects: 35,
        Cost : 37500000,
        amt: 2181,
    },
    {
        name: '2083',
        Projects: 40,
        Cost : 37500000,
        amt: 2500,
    },
    {
        name: '2084',
        Projects: 45,
        Cost : 37500000,
        amt: 2100,
    },
];

export default class Test extends PureComponent {
    render() {
        return (
            <div id="test">
                hello
                <ResponsiveContainer width="100%" height="100%">
                    <LineChart
                        width={500}
                        height={300}
                        data={data}
                        margin={{
                            top: 5,
                            right: 30,
                            left: 20,
                            bottom: 5,
                        }}
                    >
                        <CartesianGrid strokeDasharray="3 3" />
                        <XAxis dataKey="name" />
                        <YAxis />
                        <Tooltip />
                        <Legend />
                        <Line type="monotone" dataKey="Projects" stroke="#8884d8" activeDot={{ r: 8 }} />
                        <Line type="monotone" dataKey="Cost" stroke="#82ca9d" />
                    </LineChart>
                </ResponsiveContainer>
            </div>
        );
    }
}
